import React from "react";
import "../PSOne/PSone.css";
import Navigation from "./Navigation";

const Header = () => {
  return (
    <div>
      <h3>Skipper Lizbeth Thurman</h3>
      <h4>Full-Stack Web Development Portfolio</h4>
      <Navigation />
    </div>
  );
};

export default Header;
